import styled from "styled-components";
import { GiBackPain, GiEarthAmerica, GiPathDistance } from "react-icons/gi";

const Footer = () => (
  <>
    <Wrapper>
      <Border>
        <Logo />
        <Text>
          Won't stretch your budget- <Test>or your legs!</Test>
        </Text>
      </Border>
    </Wrapper>
    <Earth />
  </>
);

const Test = styled.div`
  display: inline-block;
  transform: skewX(-10deg);
`;

const Wrapper = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  width: 100%;
  background-color: var(--color-light-blue);
  height: fit-content;
  bottom: 0px;
  box-shadow: 0px 0px 2px 0px #a8dadc;
`;
const Logo = styled(GiBackPain)`
  color: var(--color-yellow);
  height: 40px;
  width: 40px;
`;
const Text = styled.div`
  color: var(--color-dark-blue);
  font-family: var(--font-heading);
  padding: 0px 20px;
  font-size: 36px;
  text-align: center;
  margin: 12px 0px;
`;
const Border = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  width: var(--main-width);
  border-left: 3px dashed var(--color-lightest);
  border-right: 3px dashed var(--color-lightest);
`;

const Earth = styled(GiEarthAmerica)`
  color: #f7ecd2;
  position: fixed;
  overflow: none;
  height: 996px;
  width: 996px;
  right: -200px;
  bottom: -300px;
  overflow: clip;
`;

const Trail = styled(GiPathDistance)`
  color: #f7ecd2;
  position: fixed;
  overflow: none;
`;

export default Footer;
